import React from "react";
import ReactDOM from "react-dom";
import add, {sub} from "./Calc";
//import { add ,mult , div }  from "./Calc";


ReactDOM.render(
    <>
    <ol>
    <h1><li>hey this is your output</li></h1>
    <li>{add(3,4)}</li>
    <li>{sub(9,5)}</li>
    
     
     </ol>
     


    </>,
    document.getElementById("root"));
